// @flow
import React from 'react';
import {Route, Switch} from 'react-router-dom';

const baseUrl = 'http://localhost:8080';


class User extends React.Component {
    /**
     * Конструктор компонента.
     * @param {*} props Свойства переданые в компонент.
     * @return {undefined}
     */
    constructor(props) {
        super(props);
        props.permissionActionGet(['User']);
    }

    path: string;

    /**
     * Вывести список клиентов.
     * @return {*} Представление.
     */
    renderUserList = () => (
            <UserList baseUrl={this.path} />
    );

    /**
     * Отображение компонента
     * @return {*} Представление компонента.
     */
    render() {
        this.path = `${this.props.baseUrl}/users`;

        return (
            <Switch>
                <Route exact path={`${this.path}/:id/:action`} render={this.renderUserList} />
                <Route exact path={`${this.path}/:action`} render={this.renderUserList} />
                <Route exact path={this.path} render={this.renderUserList} />
            </Switch>
        );
    }
}

export default User;
